import React, { useState } from "react";
import axios from "axios";

const App = () => {
  const [tab, setTab] = useState("PF"); // Alterna entre PF e PJ
  const [inputs, setInputs] = useState({ renda: "", receita: "", estado: "SP", setor: "default" });
  const [resultado, setResultado] = useState(null);

  const calcular = async () => {
    try {
      const endpoint = tab === "PF" ? "/calculate_pf" : "/calculate_pj";
      const response = await axios.post(`http://localhost:5000${endpoint}`, inputs);
      setResultado(response.data);
    } catch (error) {
      console.error("Erro ao calcular:", error);
    }
  };

  return (
    <div>
      <h1>Calculadora Tributária</h1>
      <div>
        <button onClick={() => setTab("PF")}>Pessoa Física</button>
        <button onClick={() => setTab("PJ")}>Pessoa Jurídica</button>
      </div>
      
      {tab === "PF" ? (
        <div>
          <h2>Pessoa Física</h2>
          <input
            type="number"
            placeholder="Renda"
            value={inputs.renda}
            onChange={(e) => setInputs({ ...inputs, renda: e.target.value })}
          />
          <select value={inputs.estado} onChange={(e) => setInputs({ ...inputs, estado: e.target.value })}>
            <option value="SP">São Paulo</option>
            <option value="RJ">Rio de Janeiro</option>
            <option value="MG">Minas Gerais</option>
            <option value="default">Outro</option>
          </select>
        </div>
      ) : (
        <div>
          <h2>Pessoa Jurídica</h2>
          <input
            type="number"
            placeholder="Receita"
            value={inputs.receita}
            onChange={(e) => setInputs({ ...inputs, receita: e.target.value })}
          />
          <select value={inputs.setor} onChange={(e) => setInputs({ ...inputs, setor: e.target.value })}>
            <option value="default">Geral</option>
            <option value="educacao">Educação</option>
            <option value="saude">Saúde</option>
          </select>
          <select value={inputs.estado} onChange={(e) => setInputs({ ...inputs, estado: e.target.value })}>
            <option value="SP">São Paulo</option>
            <option value="RJ">Rio de Janeiro</option>
            <option value="MG">Minas Gerais</option>
            <option value="default">Outro</option>
          </select>
        </div>
      )}
      
      <button onClick={calcular}>Calcular</button>

      {resultado && (
        <div>
          <h2>Resultado</h2>
          <p>Imposto Antigo: R$ {resultado.imposto_antigo.toFixed(2)}</p>
          <p>Imposto Novo: R$ {resultado.imposto_novo.toFixed(2)}</p>
          <p>Diferença: R$ {resultado.diferenca.toFixed(2)}</p>
        </div>
      )}
    </div>
  );
};

export default App;
